// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract AshokuCoin is ERC20, AccessControl {
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    constructor(address defaultAdmin, address minter) ERC20("AshokuCoin", "ACS") {
        _grantRole(DEFAULT_ADMIN_ROLE, defaultAdmin);
        _grantRole(MINTER_ROLE, minter);
    }

    function mint(address to, uint256 amount) public onlyRole(MINTER_ROLE) {
        _mint(to, amount);
    }
}

contract QuizGame {
    address public tokenAddress;
    uint256 public rewardAmount;
    mapping(address => bool) public hasPlayed;

    event QuizCompleted(address indexed player, bool isSuccessful);

    constructor(address _tokenAddress, uint256 _rewardAmount) {
        tokenAddress = _tokenAddress;
        rewardAmount = _rewardAmount;
    }

    function playQuiz(string[] memory answers) external {
        require(!hasPlayed[msg.sender], "Already played the quiz");
        // Logic for the quiz questions and answers

        // For simplicity, let's assume the player answers all questions correctly
        // bool quizSuccessful = true;

        require(answers.length == 5, "Incorrect number of answers provided");

        // Define quiz questions and correct answers
        string[5] memory correctAnswers = ["A", "B", "C", "D", "E"];
        
        // Check if all answers are correct
        bool quizSuccessful = true;
        for (uint256 i = 0; i < 5; i++) {
            if (keccak256(bytes(answers[i])) != keccak256(bytes(correctAnswers[i]))) {
                quizSuccessful = false;
                break;
            }
        }

        if (quizSuccessful) {
            AshokuCoin token = AshokuCoin(tokenAddress);
            token.mint(msg.sender, rewardAmount);
        }

        hasPlayed[msg.sender] = true;
        emit QuizCompleted(msg.sender, quizSuccessful);
    }
}

